import React from 'react';

import './App.css';

function App() {
  return (

    <form>
		<img src="logins.jpg" class="user" />
		<h2>Log In</h2>

			<p>Email<span style="color: red;">*</span></p>
			<input type="text" name="" placeholder="Enter Email" 
		pattern="/^[a-zA-Z0-9.!#$%&'*+/=?^_`{|}~-]+@[a-zA-Z0-9-]+(?:\.[a-zA-Z0-9-]+)*$/" required="required"/>
			<p>Password<span style="color: red;">*</span></p>
			<input type="Password" name="" placeholder="Enter Password" required="required"/>
			<input type="submit" name="" value="sign In" minlength="5" maxlength="7" required="required"/>
			<a href="#"> Forgot Password?</a>

      </form>
  );
}

export default App;
